import axios from 'axios';
import React, { useEffect, useState } from 'react';
import './App.css';

function App() {
  const [movies, setMovies] = useState(null);
  const imagesApi = "https://image.tmdb.org/t/p/w500/"

  useEffect(() => {
    axios.get("https://image.tmdb.org/t/p/w500/")
      .then(response => {
        console.log(response.data.results);
        setMovies(response.data.results);
      })
  }, [])
  return movies !== null ? (
    <div className="App">
     <ul>
       {
         movies.map((item) => {
         return(
           <div>

             <img src = {item.poster_path} alt = "picture" />
           </div>

         ) 
         })
       }
     </ul>

    </div>
  ) : (
      <p>Pas de data</p>
    )
}

export default App;
